import SearchResult from "../SearchResult";

const Search = () => {
  return (
    <section className="search">
      <div>
        <div className="search-container">
          <div className="search-form">
            123
          </div>
          <div className="search-result">
            <SearchResult />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Search;
